
$(document).ready(function () {

    var container = $("#container");
    var path = window.contextPath + "/claim-account/partial-views";
    const StatusCode = {SUCCESS: "SUCCESS", ERROR: "ERROR", PENDING: "PENDING"};

    let delayTime = 60000;
    let interValTime = 1000;
    let showCounter;

    container.on("click", "#cancel", function () {
        window.location = window.contextPath;
    });

    container.on("click", "#validate", function () {
        asyncForm.handleWithCare({
            url: window.contextPath + "/claim-account/validate",
            doneCallback: handleSecuredAccount
        });
    });

    container.on("click", "#new-mobile", function () {
        asyncForm.handleWithCare({url: window.contextPath + "/claim-account/change-mobile"});
    });

    container.on("click", "#new-mobile-email", function () {
        asyncForm.handleWithCare({url: window.contextPath + "/claim-account/change-mobile-email"});
    });

    container.on("click", "#validate-address", function () {
        asyncForm.handleWithCare();
    });

    container.on("click", "#send-sms", function () {
        asyncForm.handleWithCare({
            templateParams: {
                after: () => resendProcess.counter($("#resend-sms"), delayTime, interValTime)
            }
        });
    });

    container.on("click", "#resend-sms", function () {
        asyncForm.handleWithCare({
            url: window.contextPath + "/claim-account/resend-sms",
            templateParams: {
                after: () => resendProcess.counter($("#resend-sms"), delayTime, interValTime)
            }
        });
    });

    container.on("click", "#send-otp", function () {
        asyncForm.handleWithCare({
            templateParams: {
                after: () => resendProcess.counter($("#resend-otp"), delayTime, interValTime)
            }
        });
    });

    container.on("click", "#resend-otp", function () {
        asyncForm.handleWithCare({
            url: window.contextPath + "/claim-account/resend-otp",
            templateParams: {
                after: () => resendProcess.counter($("#resend-otp"), delayTime, interValTime)
            }
        });
    });

    container.on("click", "#verify-code", function () {
        clearInterval(showCounter);
        setOsDetails();
        asyncForm.handleWithCare({
            url: window.contextPath + "/claim-account/verify-code",
            templateParams: {
                after: v2afrsStatusCheck
            }
        });
    });


    let v2afrsStatusCheck=function() {
          var jobId = $("#job-id").val();
          mqttProperties.options.clientId = jobId;
          console.log("mqtt host url: " + window.mqtthost);
          let client = mqtt.connect(window.mqtthost , mqttProperties.options);
                 client.on("connect", () => {
                   console.log("consumer connected");
                   client.subscribe("/frs/job/" + jobId);
                 });

                 client.on("message", (topic, message, packet) => {
                   let frsStatus = message.toString();
                   //console.log("frs status: "+frsStatus)
                   const v2afrsCheckUrl = window.contextPath + "/claim-account/v2-afrs-check/" +frsStatus;
                   window.showLoadingEnabled = false;
                   asyncForm.handleWithCare({
                          url: v2afrsCheckUrl
                   });
                 });

                  client.on('error', function (error) {
                   console.log("error in mqtt sub")
                   console.log(error)
                  });

                  setTimeout(function () {
                    window.location = window.contextPath + "/?afrs=false";
                  }, 1800000);

    };

    let afrsStatusCheck = function () {
        let afrsCheckInterval;

        setTimeout(function () {
            afrsCheckInterval = setInterval(function () {
                const afrsCheckUrl = window.contextPath + "/claim-account/afrs-check";
                window.showLoadingEnabled = false;
                asyncForm.handleWithCare({
                    url: afrsCheckUrl
                });
            }, 2000);
        }, 5000);

        setTimeout(function () {
            clearInterval(afrsCheckInterval);
            window.location = window.contextPath + "/?afrs=false";
        }, 1800000);
    };

    container.on("change", "select[name=division]", function () {
        lookupLoader.load({
            path: path,
            resource: "district",
            filter: {divisionId: $(this).val()},
            target: "select[name=district]",
            remove: "select[name=upozila]"
        });
    });

    container.on("change", "select[name=district]", function () {
        lookupLoader.load({
            path: path,
            resource: "upozila",
            filter: {districtId: $(this).val()},
            target: "select[name=upozila]"
        });
    });

    container.on("change", "select[name=perDivision]", function () {
        lookupLoader.load({
            path: path,
            resource: "district",
            filter: {divisionId: $(this).val()},
            target: "select[name=perDistrict]",
            remove: "select[name=perUpozila]"
        });
    });

    container.on("change", "select[name=perDistrict]", function () {
        lookupLoader.load({
            path: path,
            resource: "upozila",
            filter: {districtId: $(this).val()},
            target: "select[name=perUpozila]"
        });
    });

    let handleSecuredAccount = function (jqXHR) {
        if (jqXHR.status === StatusCode.SUCCESS) {
            if (jqXHR.success.data) {
                showModalOfSecuredAccount(jqXHR.success.template);
            } else {
                loadTemplate(jqXHR);
            }
        } else if (jqXHR.status === StatusCode.ERROR) {
            $("input[name=captcha]").val("");
            $("#captcha-image").attr("src", window.contextPath + "/captcha/");
            errorHandler.showErrorStatus(jqXHR.error);
        }
    };

    let showModalOfSecuredAccount = function (template) {
        $('#secure-account-modal').modal({
            onApprove: function () {
                templateLoader.load({
                    templateName: window.contextPath + template
                });
            },
            onDeny: redirectToHome
        }).modal('setting', 'closable', false).modal('show');
    };

    let loadTemplate = function (jqXHR) {
        if (jqXHR.success.redirect) {
            window.location = window.contextPath + jqXHR.success.redirect;
            return;
        }
        templateLoader.load({
            templateName: window.contextPath + jqXHR.success.template
        });
    };

    let redirectToHome = function () {
        window.location = window.contextPath + "/";
    };

    function getMobileOperatingSystem() {
        let userAgent = navigator.userAgent || navigator.vendor || window.opera;

        // Windows Phone must come first because its UA also contains "Android"
        if (/windows phone/i.test(userAgent)) {
            return "unknown";
        }

        if (/android/i.test(userAgent)) {
            return "android";
        }

        // iOS detection from: http://stackoverflow.com/a/9039885/177710
        if (/iPad|iPhone|iPod/.test(userAgent) && !window.MSStream) {
            return "ios";
        }

        return "unknown";
    }

    function setOsDetails() {
        let os = getMobileOperatingSystem();
        console.log(os);
        $("#osDetails").val(os);
    }

    container.on("click", "#qr-img,#qr-zoom", function () {
        let $img = $("#qr-img");
        zoomQrCode($img)
    });

    function zoomQrCode(img) {
        let src = img.attr('src');
        let modal;
        let $body = $('body');

        function removeModal() {
            modal.remove();
            $body.off('keyup.modal-close');
        }

        modal = $('<img>').css({
            background: 'RGBA(0,0,0,.5) url(' + src + ') no-repeat center',
            backgroundSize: 'contain',
            width: '100%',
            height: '100%',
            position: 'fixed',
            zIndex: '10000',
            top: '0', left: '0',
            cursor: 'zoom-out'
        }).addClass('pixelated')
            .click(function () {
                removeModal();
            }).appendTo('body');

        $body.on('keyup.modal-close', function (e) {
            if (e.key === 'Escape') {
                removeModal();
            }
        });
    }
});

(function (global, $) {
    global.resendProcess = {
        counter: function($resendButton, delayTime, interValTime) {
            let counter = delayTime / interValTime;
            let originalMessage = $resendButton.text().trim();

            $resendButton.prop('disabled', true);
            $resendButton.addClass('button-disabled');

            let showCounter = setInterval(function () {
                counter--;
                $resendButton.text(getMessage(originalMessage, counter));
            }, interValTime);

            setTimeout(function () {
                clearInterval(showCounter);
                if ($resendButton.length > 0) {
                    $resendButton.prop('disabled', false);
                    $resendButton.removeClass('button-disabled');
                    $resendButton.text(originalMessage);
                }
            }, delayTime)
        },
    };

    function getMessage(originalMessage, counter) {
        let counterString = "";
        let banglaDigits = ["০", "১", "২", "৩", "৪", "৫", "৬", "৭", "৮", "৯"];

        if (originalMessage[0] <= 'A' && originalMessage[0] >= 'Z') {
            if (counter < 10) {
                counterString += banglaDigits[counter];
            } else {
                counterString += banglaDigits[Math.floor(counter / 10)] + banglaDigits[counter % 10];
            }
        } else {
            counterString = counter;
        }
        return originalMessage + " (" + counterString + ")";
    }
}) (window, jQuery)

(function (globalScope, $) {

    var path = globalScope.contextPath + "/citizen-home/lookup";

    function populateElements(els, json) {
        var html = '';
        for (var key in json) {
            if (json.hasOwnProperty(key)) {
                html += '<option value="' + key + '">' + json[key] + '</option>'
            }
        }
        $(els).append(html);
    }

    function removeElements(els) {
        // Removing all option elements from select element
        $(els).find("option:gt(0)").remove();

        // Removing item list from input elements with autocomplete menus
        $(els).each((index, element) => {
            if ($(element).hasClass("ui-autocomplete-input")) {
                $(element).autocomplete({
                    source: []
                });
            }
        });
    }

    function resetElements(els) {
        $(els).val("");
    }

    function hideElements(els) {
        $(els).hide();
    }

    //public interface
    globalScope.lookupLoader = {
        load: function (options) {
            var data = new FormData();
            for (var key in options.filter) {
                if (options.filter.hasOwnProperty(key)) {
                    data.append(key, options.filter[key]);
                }
            }
            if (typeof options.path !== "undefined") {
                path = options.path;
            }
            var defer = $.ajax({
                type: 'POST',
                url: path + "/" + options.resource,
                data: data,
                dataType: 'text',
                processData: false,
                contentType: false
            });
            defer.done(function (response) {
                var errorMessageElement = $("#error-block");
                var resp = JSON.parse(response);
                resetElements(options.reset);
                removeElements(options.target);
                removeElements(options.remove);
                hideElements(options.hide);
                if (resp.status === "ERROR") {
                    errorMessageElement.addClass("error").show()
                        .find("ul > li").text(resp.error.message);
                    return;
                }
                //expecting success here
                errorMessageElement.hide().find("ul > li").text("");
                populateElements(options.target, resp);
                if(typeof options.done !== 'undefined') {
                    options.done();
                }
            });
        }
    }

    globalScope.searchBoxLookupLoader = {
        load: function (options) {
            var data = new FormData();
            for (var key in options.filter) {
                if (options.filter.hasOwnProperty(key)) {
                    data.append(key, options.filter[key]);
                }
            }
            if (typeof options.path !== "undefined") {
                path = options.path;
            }
            var defer = $.ajax({
                type: 'POST',
                url: path + "/" + options.resource,
                data: data,
                dataType: 'text',
                processData: false,
                contentType: false
            });
            var elementList = [];
            var elementMap = [];
            defer.done(function (response) {
                var errorMessageElement = $("#error-block");
                var resp = JSON.parse(response);
                resetElements(options.reset);
                removeElements(options.target);
                removeElements(options.remove);
                hideElements(options.hide);
                if (resp.status === "ERROR") {
                    errorMessageElement.addClass("error").show()
                        .find("ul > li").text(resp.error.message);
                    return;
                }
                errorMessageElement.hide().find("ul > li").text("");
                for (let key in resp) {
                    if (resp.hasOwnProperty(key)) {
                        elementList.push(resp[key]);
                        elementMap[resp[key]] = key;
                    }
                }

                $(options.target).autocomplete({
                    source: elementList,
                    minLength: 0,
                    change: function (event, ui) {
                        let val = $(this).val();
                        let exists = $.inArray(val, elementList);
                        if (exists < 0) {
                            $(this).val("");
                            $(options.elementToUpdate).val("");
                            return false;
                        }
                        $(options.elementToUpdate).val(elementMap[val]);
                    },
                    select: function (event, ui) {
                        let val = ui.item.label;
                        $(this).val(val);
                        $(options.elementToUpdate).val(elementMap[val]);
                        return false;
                    }
                }).on('focus', function () {
                    $(this).autocomplete("search", this.value);
                }).on('keyup', function (event) {
                    if (event.keyCode !== 13) { // not enter
                        let val = $(this).val();
                        let exists = $.inArray(val, elementList);
                        if (exists < 0) {
                            $(options.elementToUpdate).val("");
                            return false;
                        }
                        $(options.elementToUpdate).val(elementMap[val]);
                    }
                });

                if (typeof options.done !== 'undefined') {
                    options.done();
                }
            });
        }
    }
})(window, jQuery);

$(document).ready(function() {
    var $image = $("#captcha-image");
    var initialPageLoad = true;
    $image.load(function() {
        initialPageLoad = false;
    }).error(function() {
        if(!initialPageLoad) {
            window.location = window.contextPath + "/?session-expired=true";
        }
    });
    $image.attr("src", window.contextPath + "/captcha/?t=" + Date.now());
    $("#reload-captcha").on("click", function() {
        $image.attr("src", window.contextPath + "/captcha/?t=" + Date.now());
    });
});

